import React from "react";

const ArticlePreviewItem = ({ title, description, imgpreview }) => {
  return (
    <div className="flex">
      <div className="w-24">
        <img src={imgpreview} alt="Logo" />
      </div>
      <div>
        <h2>{title}</h2>
        <p className="text-cyan-800">{description}</p>
      </div>
    </div>
  );
};

export default ArticlePreviewItem;
